import React from 'react';
import { Link } from 'react-router-dom';

const DashboardPage = () => {
  return (
    <div>
      <h1>Панель управления</h1>
      <nav>
        <ul>
          <li>
            <Link to="/schedule">Расписание</Link>
          </li>
          <li>
            <Link to="/bookings/new">Создать встречу</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default DashboardPage;
